import './App.css';
import React from 'react';
import { Route, Routes } from 'react-router-dom';
import HomeFeature from './features/home';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='home' element={ <HomeFeature /> } exact/>
      </Routes>
    </div>
  );
}

export default App;
